import React, { useState } from "react";

function Navbar() {
  const [showNavbar, setShowNavbar] = useState(true);

  function toggle() {
    setShowNavbar(!showNavbar);
  }

  return (
    <div className="container">
      <nav>
        <img
          className="logo"
          src="https://jubileeinsurance.com/ke/wp-content/uploads/2021/03/mortage.jpg"
          alt="Logo"
        />
        <div className="row">
          <ul style={{ display: showNavbar ? "none" : "block" }}>
            <li>Home</li>
            <li>About</li>
            <li>Financial Planning</li>
            <li>Investment Planning</li>
            <li>Insurance</li>
            <li>Blog</li>
            <li>Contact Us</li>
          </ul>
        </div>
        <button className="btn btn-primary" onClick={toggle}>
          Menu
        </button>
      </nav>
    </div>
  );
}

export default Navbar;
